Porterage (coolie charges), laundry, telephone charges, shopping , or extra beverages mineral water, items of personal nature<\/li><\/ul>","sightseeing_array":"[{\"attraction\":\"Arrive Kathmandu\",\"daywise_program\":\"Meeting at airport upon arrival by Office Personnel. Kathmandu is the capital of Nepal and the Kathmandu Valley is the political and cultural heart of the Kingdom.\\n\\nAfter arrival you will be transferred to the hotel.\",\"overnight_stay\":\"Kathmandu\",\"meal_plan\":\"\"},{\"attraction\":\"Kathmandu\",\"daywise_program\":\"This morning you will be taken for a visit of the Hindu culture in Nepal, Pashupatinath.\\n\\nWe then continue to the holiest shrine for the Buddhist culture in Nepal, Bouddhanath, with its large stupa, this is the place where Buddhists devout come for a pilgrimage.\",\"overnight_stay\":\"Kathmandu\",\"meal_plan\":\"\"},{\"attraction\":\"Kathmandu-Chandragiri Hills - Kathmandu\",\"daywise_program\":\"This morning you will be taken for Chandragiri Hills, 17 kilometres approx from city center, lies on the South-West of Kathmandu Valley.\\n\\nDrive from your hotel to Thankot and then take a cable car to Chandragiri Hills. Chandragiri Cable Car is a gondola lift transportation system located in Kathmandu, Nepal. Opened on 2016, the Chandragiri Cable Car runs from Thankot to Chandragiri hills.\\n\\nLater visit Thamel which is the Tourist hub of Nepal.\",\"overnight_stay\":\"Kathmandu\",\"meal_plan\":\"\"},{\"attraction\":\"Kathmandu to Airport\",\"daywise_program\":\"Morning will be comparatively free and closer to the time of your flight you will be transferred to the airport in time to board your flight for onward journey.\",\"overnight_stay\":\"Tour End.\",\"meal_plan\":\"\"}]","hotel_array":"[{\"city_name\":\"Kathmandu Nepal\",\"hotel_name\":\"Hotel Shanker Kathmandu\",\"hotel_type\":\"3 Star\",\"total_night\":\"3\"}]","transport_array":"[{\"vehicle_name\":\"INNOVA\",\"pickup_type\":\"city\",\"pickup\":\"Kathmandu Nepal\",\"drop_