hen and how you will leave St. Kitts and Nevis<\/div>"},{"entry_id":"183","country":"Saint Lucia","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Original Passport with at least 6 months validity and minimum 3 blank pages + all old passports if any<\/div><div>2. 2 Scanned recent colour photograph. (Photo Specification);<\/div><div>3. Visa Application forms: completed and signed<\/div><div>4. Personal Covering letter: explaining purpose of travel to the country<\/div><div>5. Original Bank Statement: stamped &amp; updated for last 3 months with bank seal<\/div><div>6. Air tickets: proof of return flight tickets from and back to your home country<\/div><div>7. Hotel reservation: proof of accommodation for your entire stay<\/div><div>8. Travel Itinerary: day-wise plan outlining all elements of the trip<\/div>"},{"entry_id":"184","country":"Saint Pierre And Miquelon","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Passport must be valid for a minimum of 6 months<\/div><div>2. Valid ID card(if required)<\/div><div>3. Original birth certificate (if required)<\/div>"},{"entry_id":"185","country":"Saint Vincent And The Grenadines","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. General documents<\/div><div>2. Birth,Death,Burial certificates<\/div><div>3. Marriage, Divorce certificates<\/div><div>4. Adoption certificates<\/div><div>5. Identity card<\/div><div>6. Police, court,prison records<\/div><div>7. Military records<\/div><div>8. Passports &amp; other travel documents<\/div><div>9. Other records<\/div><div>10. Visa issuing posts<\/div><div>11. Visa services<\/div><div><br><\/div>"},{"entry_id":"186","country":"Samoa","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Original Passport with at least 6 months validity and minimum 3 blank pages + all old passports if any<\/div><div>2. 2 Scanned recent colour photograph. (Photo Specification);<\/div><div>3. Confirmed return flight ticket<\/div><div>4. Accommodation proof (hotel booking or invitation letter if visiting relative\/friend)<\/div><div>5. Sufficient financial funds (while in Samoa)<\/div><div>6. Supporting documents relating to Business trip<\/div>"},{"entry_id":"187","country":"San Marino","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Hold a passport valid for at least six months beyond your date of country exit and with one blank visa page<\/div><div>2. Hold proof of onward and return flights<\/div><div>3. Hold all documents required for the next destination<\/div><div>4. Hold documents showing proof of travel purpose (e.g. business cover or support letter, conference registrations, etc.)<\/div><div>5. Hold proof of sufficient funds relative to your intended length of stay<\/div><div>6. It is recommended that you confirm with your airline that boarding will be permitted without a visa<\/div>"},{"entry_id":"188","country":"Sao Tome And Principe","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Hold a biometric passport valid for at least six months with at least one blank visa page<\/div><div>2. Hold proof of onward and return flights<\/div><div>3. Hold all documents required for the next destination<\/div><div>4. Hold proof of sufficient funds relative to your intended length of stay<\/div><div>5. Confirm with your airline prior to your travel date that boarding will be permitted without a visa<\/div>"},{"entry_id":"189","country":"Saudi Arabia","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 