"total_days":"30 Days","form_1":"","form_2":"","documents":"<div><ol><li><b>Visa Application Form (Form 14A) :<\/b> Complete and sign the official visa application form.<\/li><li><b>Passport : <\/b>Your passport must be valid for at least six months from your intended date of entry into Singapore and should have a minimum of two blank pages.<span style=\"white-space: pre;\">\t<\/span><\/li><li><b>Photographs : <\/b>Two recent passport-sized color photographs (35mm x 45mm) taken within the last three months against a white background.<span style=\"white-space: pre;\">\t<\/span><\/li><li><b>Cover Letter : <\/b>A signed cover letter detailing the purpose of your visit, duration of stay, and travel itinerary. For self-employed individuals, this should be on company letterhead.<\/li><li><b>Flight Itinerary : <\/b>Confirmed round-trip flight bookings.<\/li><li><b>Proof of Accommodation : <\/b>Hotel reservations or an invitation letter from a host in Singapore, if applicable.<\/li><li><b>Bank Statements : <\/b>Personal bank statements for the last six months, duly stamped and signed by the bank.<\/li><li><b>Letter of Introduction (Form V39A) : <\/b>May be required if requested by the authorities. This letter should be issued by a local contact in Singapore who is a citizen or permanent resident aged 21 or above.<\/li><li><b>Employment Proof :&nbsp;<\/b><\/li><\/ol><\/div><div><ul><li>For employed individuals: recent salary slips and an employment ID card.&nbsp;<\/li><li>For self-employed individuals: business registration documents.<\/li><\/ul><div><div><br><\/div><div><br><\/div><div><i><b>Special for Indians:<\/b><\/i><\/div><div><ol><li><i>Indian passport holders must apply for a visa before travel.<\/i><\/li><li><i>Can apply through Authorized Visa Agents in India or Singapore High Commission.<\/i><\/li><li><i>Biometrics not required for regular tourist visa.<\/i><\/li><li><i>Indian citizens with valid visas or residence permits from the US, UK, Schengen, Australia, New Zealand, or Japan may be eligible for a Singapore e-Visa (iVisa scheme).<\/i><\/li><\/ol><\/div><\/div><\/div><div><br><\/div>"},{"entry_id":"195","country":"Slovakia","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<div>7. Income tax returns<br>8. Itinerary<br>9. Hotel voucher<br>10. Covering letter from applicant<\/div><div>11. Sponsorship letter<br>12. NOC letter from parents to child<\/div>"},{"entry_id":"196","country":"Slovenia","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Hotel voucher<br>10. Visa application form<br>11. Covering letter from applicant<div>12. NOC letter from parents to child<\/div><div>13. Marriage certificate&nbsp;<\/div>"},{"entry_id":"197","country":"Solomon Islands","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days ","form_1":"","form_2":"","documents":"1. Passport<br>2. Photo<br>3. Bank statement<br>4. Air ticket<br>5. Itinerary&nbsp;<br>6. Hotel vocuher&nbsp;"},{"entry_id":"198","country":"Somalia","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>"},{"entry_id":"199","country":"South Africa","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Old passport<div>3. Photo<br>4. Air ticket<br>5. Yellow fever vaccination&nbsp;<br>6. Visa application form<br>7. Covering letter from applicant<br>8. Bank statement<br>9. Hotel voucher<br>10. NOC letter&nbsp; from parents to child&nbsp;<br>11. Relationship proof<br>12. Itinenary&nbsp;<\/div>"},{"entry_id":"200","country":"South Georgia And The South Sandwich Islands","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Visa application form<\/div><div>2. Passport photo<\/div><div>3. Passport<\/div><div>4. Previous passport<\/div><div>5. Residency proof<\/div><div>6. Proof of funds&nbsp;<\/div><div>7. Current details<\/div><div>8. Travel Itinerary<\/div><div>9. Hotel bookings<\/div><div><br><\/div>"},{"entry_id":"201","country":"Spain","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Hotel voucher<br>10. Covering letter from applicant<br>11. Copies of all pages of passport<br>12. NOC letter from parents to child&nbsp;<br>13. Marriage certificate&nbsp;"},{"entry_id":"202","country":"Sri Lanka","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div><ol><li><b>Passport<\/b> : Must be valid for at least 6 months from arrival date.<\/li><li><b>ETA Application Form<\/b> : Completed online via https:\/\/www.eta.gov.lk.<\/li><li><b>Passport-size Photo (optional) <\/b>: Sometimes required depending on application method.<\/li><li><b>Return Air Ticket<\/b> : Proof of departure from Sri Lanka.<\/li><li><b>Proof of Accommodation<\/b> : Hotel booking or invitation letter.<\/li><li><b>Visa Fee <\/b>: Payable online (free or discounted for some nationalities).<\/li><\/ol><\/div>"},{"entry_id":"203","country":"Sudan","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Old passport<b