g of roundtrip air ticket to Svalbard (Longyearbyen), and other travels within the<\/div><div>Schengen area, if applicable. Do not purchase the ticket until a visa has been granted.<\/div><div>10. Minors (under 18 years of age):<\/div><div>- student card and\/or original letter from the school, mentioning:<\/div><div>o full address, telephone number(s) of the school<\/div><div>o name and function of the person giving permission<\/div><div>o approval for leave of absence<\/div><div>- Proof of relationship or guardianship.<\/div><div>- When applicant is travelling alone, or only with one parent: letter of permission to travel signed<\/div><div>by both parents or legal guardians, and copy of the passport of the parent not travelling.<\/div><div>11. Letter granting Power of Attorney (optional for applicants who want the sponsor or other person to<\/div><div>represent them in the case).<\/div><div>12. If applicable, a written explanation as to why the applicant cannot present any or some of the<\/div><div>documents<\/div>"},{"entry_id":"206","country":"Swaziland","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Passport requirements<\/div><div>2. Proof of travel arrangements<\/div><div>3. Special instructions<\/div>"},{"entry_id":"207","country":"Sweden","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Relationship proof<br>10. Covering letter from applicants<br>11. Hotel vocuher"},{"entry_id":"208","country":"Switzerland","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Hotel voucher<br>10. Covering letter from applicant&nbsp;"},{"entry_id":"209","country":"Syrian Arab Republic","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Photo<br>3. Air ticket<br>4. Guarantee letter&nbsp;<br>5. Old passport"},{"entry_id":"210","country":"Taiwan","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Covering letter from applicant<br>6. Bank statement<br>7. Income tax returns<br>8. Itinenry&nbsp;"},{"entry_id":"211","country":"Tajikistan","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Air ticket<br>3. Photo<br>"},{"entry_id":"212","country":"Tanzania","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br><div>2. Photo<br>3. Air ticket<br>4. Yellow fever vaccination<br>5. Covering letter from applicant<\/div><div>6. Bank statement<br>7. Itinerary&nbsp;<\/div>"},{"entry_id":"213","country":"Thailand","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div><ol><li><b>Passport: <\/b>Valid for at least 30 days from entry, with 1 blank page.<\/li><li><b>Passport Photo: <\/b>One recent (4x6 cm), not older than 6 months.<\/li><li><b>Visa Application Form: <\/b>Filled on arrival or online via https:\/\/thaievisa.go.th.<\/li><li><b>Return Flight Ticket:<\/b> Proof of departure within 15 days.<\/li><li><b>Hotel Booking: <\/b>Confirmed accommodation for the entire stay.<\/li><li><b>Proof of Funds: <\/b>Minimum THB 10,000 per person \/ THB 20,000 per family (in cash or bank statement).<\/li><li><b>Visa Fee: <\/b>THB 2,000 (payable in Thai Baht, cash only, at airport).<\/li><li><b>COVID Insurance: <\/b>Not mandatory, but recommended.<\/li><\/ol><\/div><div><br><\/div><div><div><b><i>Special for Indians:<\/i><\/b><\/div><div><ol><li><i>Indian passport holders are eligible for Thailand Visa on Arrival.<\/i><\/li><li><i>E-VOA available via https:\/\/thailandevoa.vfsevisa.com for faster processing.<\/i><\/li><li><i>Must enter via designated airports (e.g., Bangkok, Phuket, Chiang Mai).<\/i><\/li><\/ol><\/div><\/div>"},{"entry_id":"214","country":"Togo","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Your passport, with a validity of at least another six months from the end of your stay and at least two blank pages.<\/div><div>2. Photocopies of the first two pages of your passport.<\/div><div>3. The Togo visa application form<\/div><div>4. Two recent passport-size pictures, with the following requirements:<\/div><div>5. Dimensions: 4.5 x 3.5 cm<\/div><div>6. White background<\/div><div>7. Neutral facial expression<\/div><div>8. Your face and head must be fully visible (headgear only accepted for religious purposes, provided it does not obstruct the face)<\/div><div>9. Proof you have purchased or booked a return flight ticket.<\/div><div>10. Travel insurance for the duration of your stay, or proof you have paid a repatriation deposit<\/div><div>11. Yellow Fever Certificate or the vaccination notebook<\/div><div>12. Proof of accommodation in Togo, such as a hotel reservation<\/div>"},{"entry_id":"215","country":"Tokelau","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Passport validity<\/div><div>2. Blank visa pages<\/div><div>3. Tokelau visa application form<\/div><div>4. Original, signed United State passport<\/div><div>5. (2) passport photographs<\/div><div>6. An itinerary of your 